import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import IPRForm from './components/mainexhibitionpage'; // Import the IPRForm component
import Register from './components/register';
import Login from './components/login';
import AfterRegistration from './components/AfterRegistration';
import './index.css';

const App = () => {
    return (
        <Router>
            <Routes>
                <Route path="/" element={<Register />} /> {/* Home route with IPRForm */}
                <Route path='/AfterRegistration' element={<AfterRegistration/>}></Route>
                <Route path='/login' element={Login}></Route>
                <Route path='/IPRForm' element={IPRForm}></Route>
            </Routes>
        </Router>
    );
};

export default App;
